using Missile.Missile;
using Missile.Missile.Api;
using Missile.Missile.Impl;
using Missile.MissileController;
using Missile.Utils;
using System;
using System.Windows.Forms;

namespace Missile
{
    public partial class FormSetting : Form
    {
        //唯一弹幕窗体
        private IMissileController missileController;

        public FormSetting()
        {
            InitializeComponent();
            //初始化弹幕控制器
            this.missileController = new NormalMissileController();
        }
        /// <summary>
        /// 打开关闭
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void btnToggleMissile_Click(object sender, EventArgs e)
        {
            if (this.missileController.isStarted())
            {
                this.missileController.Stop();
                this.btnToggleMissile.Text = "打开弹幕";
            }
            else
            {
                this.missileController.Start();
                this.btnToggleMissile.Text = "关闭弹幕";
            }
        }
        /// <summary>
        /// OnLoad
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void FormSetting_Load(object sender, EventArgs e)
        {
            this.btnToggleMissile.PerformClick();
        }
        /// <summary>
        /// 分发Message
        /// </summary>
        /// <param name="message"></param>
        private void serverConnector_Message(string message)
        {
            Console.WriteLine("Recive New Missile");
            Action createMissile = () =>
            {
                DeliverBean bean = JSON.toObject<DeliverBean>(message);
                IMissile missile = null;
                switch (bean.missileType)
                {
                    case MISSILE_TYPE.TEXT:
                        missile = new TextMissile(bean.text);
                        break;
                    case MISSILE_TYPE.IMAGE:
                        missile = new ImageMissile(bean.base64Img);
                        break;
                    case MISSILE_TYPE.FS_IMAGE:
                        missile = new FullScreenMissile(bean.base64Img, bean.text);
                        break;
                }
                this.missileController.SendMissile(missile);
            };
            this.BeginInvoke(createMissile);
        }
        /// <summary>
        /// 
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void FormSetting_Resize(object sender, EventArgs e)
        {
            if(this.WindowState == FormWindowState.Minimized)
            {
                this.ShowInTaskbar = false;
            }
            else if(this.WindowState == FormWindowState.Normal)
            {
                this.ShowInTaskbar = true;
            }
        }
        /// <summary>
        /// 双击通知图标
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void notifyIcon_MouseDoubleClick(object sender, MouseEventArgs e)
        {
            this.WindowState = FormWindowState.Normal;
        }

        #region TEST
        /// <summary>
        /// 测试文本
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void btnTextTest_Click(object sender, EventArgs e)
        {
            var txtMissile = new TextMissile("Hello，GDI+");
            this.missileController.SendMissile(txtMissile);
        }
        /// <summary>
        /// 测试图片
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void btnImageTest_Click(object sender, EventArgs e)
        {
            var imgMissile = new ImageMissile("");
            this.missileController.SendMissile(imgMissile);
        }
        /// <summary>
        /// 测试霸屏
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void btnFullScreenTest_Click(object sender, EventArgs e)
        {
            var fsImgMissile = new FullScreenMissile("",
                "呵呵呵呵");
            this.missileController.SendMissile(fsImgMissile);
            fsImgMissile = new FullScreenMissile("",
                "哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈");
            this.missileController.SendMissile(fsImgMissile);
        }
        #endregion

    }
}
